  const { pasos } = useOrdersContext();
  return (
    <div>
      {pasos === 1 ? <CheckOutForm /> : ""}
      {pasos === 2 ? <CheckOutConfirm /> : ""}
      {pasos === 3 ? <CheckOutId /> : ""}
    </div>
  );
};

export default CheckOut;
